import React from 'react'
import {NavLink} from 'react-router-dom'
import {connect} from 'react-redux'
import {signOut} from '../../store/actions/authActions'

const SignedInLinks = (props) => {
	return (
		<ul className="right">
			<li><NavLink to='/add' className="black-text">New Blog<i class="material-icons right large">add_circle</i></NavLink></li>
			<li> <a onClick={props.signOut} className="black-text">Log Out</a> </li>
			<li><NavLink to='/' className='btn btn-floating black lighten-1'>{props.profile.initials}</NavLink></li>
		</ul>
	)
}

const mapDispatchToProps = (dispatch) => {
	return {
		signOut: () => dispatch(signOut()) 
	}
}

export default connect(null,mapDispatchToProps)(SignedInLinks);
